  [],\n\t\"revision_timestamp\": \"2015-06-19T15:26:07.903605\",\n\t\"name\": \"digital-flood-insurance-rate-map-database-northumberland-county-virginia\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Digital Flood Insurance Rate Map (DFIRM)
  Database depicts flood risk information and supporting data used to develop the
  risk data. The primary risk classifications used are the 1-percent-annual-chance
  flood event, the 0.2-percent-annual-chance flood event, and areas of minimal flood
  risk. The DFIRM Database is derived from Flood Insurance Studies (FISs), previously
  published Flood Insurance Rate Maps (FIRMs), flood hazard analyses performed in
  support of the FISs and FIRMs, and new mapping data, where available. The FISs and
  FIRMs are published by the Federal Emergency Management Agency (FEMA). The files
  are georeferenced to the earth's surface using the North American Datum of 1983
  (NAD 83) HARN Virginia State Plane south zone (FIPSZONE 4502) coordinate system
  and the Lambert Conformal Conic projection. The specifications for the horizontal
  control of DFIRM data files are consistent with those required for mapping at a
  scale of 1:12,000.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
